import React from 'react';
import './App.css';

function App() {
  return (
    <div className="app-container">
      {/* Caja del Número Aleatorio */}
      <div className="current-number-box">
        <div className="current-number">00</div>
      </div>

      {/* Caja a la Derecha del Número Aleatorio */}
      <div className="additional-box">
        <div className="additional-content">Additional Box</div>
      </div>
    </div>
  );
}

export default App;
